      <h3 className="text-2xl font-normal">I'd love to chat!</h3>
      <div className="flex items-center"> 
        <i className="far fa-envelope text-3xl mr-2"></i>
        <a href=""> matthewbasile2@gmail.com</a>
      </div>

    </div>
  )
}
